import React, { useContext } from "react";
import { NavLink } from "react-router-dom";
import { authContext as AuthContext } from "../context/authContext"; // Assurez-vous que l'importation correspond à ce qui est exporté dans authContext.jsx
import "./styles/navbar.css";

const Navbar = () => {
  const { logout } = useContext(AuthContext); // Utilisez le contexte avec le bon nom

  const handleLogout = () => {
    logout(); // Appel de la fonction logout
  };

  return (
    <header className="header">
      <nav className="nav container">
        <NavLink to="/" className="nav__logo">
          Navigation Bar
        </NavLink>
        <ul className="nav__list">
          <li>
            <NavLink to="/" className="nav__link">
              Home
            </NavLink>
          </li>
          <li>
            <NavLink to="/profile" className="nav__link">
              Profile
            </NavLink>
          </li>
          <li>
            <NavLink to="/about-us" className="nav__link">
              About Us
            </NavLink>
          </li>
          <li>
            <NavLink to="/login" className="nav__link" onClick={handleLogout}>
              Logout
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
